            <section className="section">
              <h1 className="section-heading">Danh Sách Sản Phẩm</h1>
              <div className="row">
                {/* Product */}

              </div>
            </section>
            {/* Message */}
            <h3>
              <span className="badge amber darken-2">Mua Hàng Thành Công !</span>
            </h3>
